  render() {
     const { groupItem, educationTypes } = this.props;
     console.log(groupItem,'groupItem');
    return (
      <TableRow 
    //  key={groupItem.id}
      >

        <TableCell>{"groupe.name1"},{"groupe.name2"}</TableCell>
        <TableCell>
          {groupItem.name}
         </TableCell>
        {this.props.archived == false ? (
          <TableCell>
            <IconButton
              size="large"
              className="icon-btn"
              onClick={(e) => this.props.handleEdit(groupItem, e)}
              value={groupItem.id}
            >
              <i className="zmdi zmdi-edit " style={{ color: "text-grey" }} />
            </IconButton>
            &nbsp; | &nbsp;
            <IconButton
              size="large"
              className="icon-btn"
               onClick={(e) => this.props.handleDelete(groupItem, e)}
            >
              <i className="zmdi zmdi-delete" style={{ color: "text-grey" }} />
            </IconButton>
          </TableCell>
        ) : (
          <TableCell></TableCell>
        )}
      </TableRow>
    );
  }
}
